import React from "react";
import { Route, Switch } from "react-router-dom";
import Three from "./components/three";
import Carry from "./components/carrybox/carry";
import Carry_S from "./components/carrybox/carry_shape";

const App = () => {
  return (
    <Switch>
      <Route exact path="/" component={Three} />
      <Route exact path="/carry" component={Carry} />
      <Route exact path="/carry_s" component={Carry_S} />
    </Switch>
  );
};

export default App
